import React, { Component } from "react";
import cx from "classnames";
import styled from "styled-components";
const SearchWrap = styled.div`
   {
    position: relative;
    margin: 56px auto 0;
    font-size: 18px;
    width: 306px;

    .placeholder {
      color: #aaa;
    }
    input {
      outline: none  
      box-sizing: border-box;
      height: 52px;
      padding: 0px 53px;
      border-radius: 26px;
      border: 0px !important;
      width: 100%;
      box-sizing: border-box;

      &:hover:not(:focus) {
        background-color: #f0f0f0 !important;
      }

      &:not(:hover):not(:focus) {
        background-color: #f7f7f7 !important;
      }

      &:focus:not(:hover) {
        background-color: #f0f0f0 !important;
      }

      &:hover:focus {
        background-color: #f0f0f0;
      }

      &::-webkit-input-placeholder {
        color: #9e9e9e;
      }

      &::-moz-placeholder {
        color: #9e9e9e;
      }

      &::-moz-placeholder {
        color: #9e9e9e;
      }

      &::-ms-input-placeholder {
        color: #9e9e9e;
      }
    }

    .icon {
      position: absolute;
      top: 16px;
    }

    .search {
      left: 18px;
    }

    .close {
      right: 18px;
      color: #bdbdbd;

      &:hover {
        color: #757575;
      }
    }

    .hide {
      display: none !important;
    }
  }
`;
export default class Search extends Component {
  state = { value: "" };

  render() {
    const { className, onFocus } = this.props;
    const { value } = this.state;
    return (
      <SearchWrap className={cx("SearchWrap ", className)}>
        <input
          type="text"
          className="ThemeBorderColor3 Font15"
          value={value}
          placeholder="搜索模板库"
          onChange={(e) => {
            this.setState({ value: e.target.value });
            if (!e.target.value) {
              this.props.getSearch(e.target.value);
            }
          }}
          onKeyUp={(e) => {
            if (e.keyCode === 13) {
              this.props.getSearch(e.target.value);
            }
          }}
        />
        {/* <i
          type="search"
          className="icon icon-search search Black18 Alpha6 Font22"
        /> */}
        <img
          style={{
            position: 'absolute',
            top: '18px',
          }}
          onClick={() => {
            this.setState({ value: "" });
            this.props.getSearch("");
          }}
          className="search Hand Alpha6"
          src="data:image/png;base64,"
        />
        {/* <i
          onClick={() => {
            this.setState({ value: "" });
            this.props.getSearch("");
          }}
          className={cx("icon icon-close close pointer Black18 Alpha6", {
            hide: !value.length,
          })}
        /> */}
        <img
          style={{
            position: 'absolute',
            top: '18px',
            height: '13px',
          }}
          onClick={() => {
            this.setState({ value: "" });
            this.props.getSearch("");
          }}
          className={cx("close Hand Alpha6", {
            hide: !value.length,
          })}
          src="data:image/png;base64,"
        />
      </SearchWrap>
    );
  }
}
